import '@babel/polyfill';
import axios from 'axios';
import {showAlert} from './alerts';

// type is either password or data
export const updateSettings = async (data, type) => {

  const url = type ==='password' 
  ? 'http://127.0.0.1:8000/api/v1/members/updateMyPassword'
  : 'http://127.0.0.1:8000/api/v1/members/updateMe';

 
  try{
    const res = await axios({
      method: 'PATCH',
      url: url,
      data
    });
  
    if (res.data.status === 'success') {
      showAlert('success', `${type.toUpperCase()} updated successfully!`);
    }
  } catch(err) {
   
    showAlert('error', err.response.data.message);
  }
}

export const signupSettings = async (data) => {
  
  const url =  'http://127.0.0.1:8000/api/v1/members/signup';
  try{
    const res = await axios({
      method: 'POST',
      url: url,
      data: {
        firstName: data.get('firstName'),
        lastName: data.get('lastName'),
        email: data.get('email'),
        password: data.get('password'),
        passwordConfirm: data.get('passwordConfirm'),
        phone: data.get('phone'),
        partner: data.get('partner'),
        addressStreet: data.get('addressStreet'),
        addressCity: data.get('addressCity'),
        addressState: data.get('addressState'),
        howdYouHear: data.get('howdYouHear'),
        reasonForJoining: data.get('reasonForJoining'),
        danceExperience: data.get('danceExperience')
      }
    
    })
    
    if (res.data.status === 'success') {
      showAlert('success', `Signed up successfully!`);
    }
  } catch(err) {
    
    showAlert('error', err.response.data.message);
  }
}

export const deleteMe = async (member) => {
  
  const url =  'http://127.0.0.1:8000/api/v1/members/deleteMe';
  try{
    const res = await axios({
      method: 'DELETE',
      url: url
    
    })
    
    if (res.data.status === 'success') {
      showAlert('success', `Signed up successfully!`);
    }
  } catch(err) {
    
    showAlert('error', err.response.data.message);
  }
}
export const updateMember = async (data) => {

  const url =  `http://127.0.0.1:8000/api/v1/members/${data.get('id')}`;
  try{
    const res = await axios({
      method: 'PATCH',
      url: url,
      data: {
        firstName: data.get('firstName'),
        lastName: data.get('lastName'),
        email: data.get('email'),
        role: data.get('role'),
        phone: data.get('phone'),
        partner: data.get('partner'),
        addressStreet: data.get('addressStreet'),
        addressCity: data.get('addressCity'),
        addressState: data.get('addressState'),
        howdYouHear: data.get('howdYouHear'),
        reasonForJoining: data.get('reasonForJoining'),
        danceExperience: data.get('danceExperience')
      }
    
    })
    
    if (res.data.status === 'success') {
      showAlert('success', `Updated up successfully!`);
    }
  } catch(err) {
    
    showAlert('error', err.response.data.message);
  }
}

export const updateMemberEmail = async (email) => {

  let url =  `http://127.0.0.1:8000/api/v1/members`;
  try{
    const res = await axios({
      method: 'GET',
      url: url,
      data: {
        email: email
      }
        
    
    })
    
    if (res.data.status === 'success') {
      showAlert('success', `Got Member Email!`);
     
    }
  } catch(err) {
    
    showAlert('error', err.response.data.message);
  }
}
